import React from 'react';
import { motion } from 'framer-motion';
import NavBar from './Menu/Nav'
//import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Expériences from './Pages/Expériences/Expériences'
import Hackatons from './Pages/Hackathons/Hackathons'
import Home from './Pages/Home/Home'
import Parcours from './Pages/Parcours/Parcours'
import Projects from './Pages/Projets/Projets'
import Technologies from './Pages/Technologies/Technologies'

const App = () => {
  return (
    <Router>
      <NavBar />
      <Switch>
        <Route path="/Home" exact component={Home} />
        <Route path="/Expériences" component={Expériences} />
        <Route path="/Hackathons" component={Hackatons} />
        <Route path="/Parcours" component={Parcours} />
      </Switch>
    </Router> 
  );
};

export default App;
